import React, { useState } from "react";
import './Image.css'

interface Image {
    el: any,
    onClick: (el : any) => void
}

const Image = (element: Image, onClick) => {
    const [modal, setModal] = useState(false)

    const elem = element.el

    // if(modal) return (
    //     <div className="modalImage">
    //         <p> sadadas </p>
    //     </div>
    // )

    return (
      <div 
      onClick={ () => setModal(true)}
      className="displayElement" 
      style={{}}
      key={elem.id}>
        <img className="img" src={elem.urls.small} />
        {modal ?  
        <div className="modalImage">
            <p> sadadas </p>
        </div>
        :
        ''}
      </div>
    );
}

export default Image
